import React from 'react';
import classes from './MealsSummary.module.css';
const MealsSummary = () => {
  return (
    <section className={classes.summary}>
      <h2>Delicious Food, Delivered to You</h2>
      <p>
        Kolhapur is a foodie paradise. Kolhapuri food is world famous for its
        taste and Traditional Delicacies. Though it is being misrepresented as
        very spicy food worldwide, but the truth is that it is very less spicy,
        and the unique taste being due to the use of typical kolhapuri homemade
        masalas (spices mixture), and Onion Garlic chutney.
      </p>
      <p>
        Choose your favorite meal from our broad selection of available meals
        and enjoy a delicious lunch or dinner at home.
      </p>
      <p>
        All our meals are cooked with high-quality ingredients, just-in-time and
        of course by experienced chefs!
      </p>
    </section>
  );
};

export default MealsSummary;
